def split_cookiestr(cookie_str):
    new_str = cookie_str.split(';')
    # print(new_str)
    cookie_dict = {}
    for cks in new_str:
        ncks = cks.split('=')
        # print(ncks)
        cookie_dict[ncks[0].strip()] = ncks[1].strip()
    print(cookie_dict)
    return cookie_dict


if __name__ == '__main__':
    cookie_str = input('输入cookie将会对其进行分割:')
    cdict = split_cookiestr(cookie_str)
    print(cdict)

